function [detected_objects, bounding_boxes] = detectObstacles(rgbImage)
    % Convert to HSV for better color segmentation
    hsvImage = rgb2hsv(rgbImage);

    % Define obstacle color ranges (customize for your environment)
    obstacleRanges = {
        [0.1 0.2; 0.5 1.0; 0.3 0.8],  % Red/orange obstacles
        [0.5 0.6; 0.3 0.7; 0.2 0.6],  % Green obstacles
        [0.55 0.65; 0.1 0.5; 0.6 1.0] % Blue obstacles
    };

    detected_objects = [];
    bounding_boxes = [];

    for i = 1:length(obstacleRanges)
        % Create binary mask
        mask = createMask(hsvImage, obstacleRanges{i});

        % Remove small noise
        mask = bwareaopen(mask, 50);
        mask = imfill(mask, 'holes');

        % Find connected components
        stats = regionprops(mask, 'BoundingBox', 'Centroid', 'Area');

        for j = 1:length(stats)
            if stats(j).Area > 100  % Minimum area threshold
