                if (isPathClear(robot, target, obstacles)) {
                    currentState = DecisionState.SEEKING_TARGET;
                }
                break;

            case COOPERATING:
                nextPosition = cooperateWithOtherRobot(robot, otherRobot, target, obstacles);
                break;
        }

        return nextPosition;
    }

    private Vector3f performAvoidanceManeuver(Robot robot, List<Obstacle> obstacles) {
        Vector3f currentPos = robot.getPosition();
        Vector3f avoidanceVector = new Vector3f();

        // Calculate repulsion forces from obstacles
        for (Obstacle obstacle : obstacles) {
            Vector3f diff = currentPos.sub(new Vector3f(obstacle.getPosition()));
            float distance = diff.length();

            if (distance < 2.0f) {  // Within 2 meters
                float repulsionStrength = 2.0f / (distance * distance);
                Vector3f repulsion = diff.normalize().scale(repulsionStrength);
                avoidanceVector.add(repulsion);
            }
        }

        // Calculate attraction to target
        Vector3f targetAttraction = robot.getTargetPosition().sub(currentPos).normalize().scale(0.5f);

        // Combine forces
        return currentPos.add(avoidanceVector.add(targetAttraction));
    }
}
